import axios from 'axios';
import React, { useEffect, useState } from 'react'
import { useHistory, useParams } from 'react-router'

export default function UserDisplay(props) {
    const [userToDisplay, setUserToDisplay] = useState({});
    let history = useHistory();

    useEffect(() => {
        axios.get("http://localhost:8080/api/users/" + props.id)
            .then(response => {
                if(response.data.biography){
                    //User was found
                    setUserToDisplay(response.data)
                } else{
                    //User was not found
                    history.push("/");
                }
            })
            .catch(err => console.log(err));
    }, [])

    return (
        <>
            <div className="text-start bg-light" style={{height:"175px",objectPosition:"center", background: "url('https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT_hhfuTqUbHZkqdsxncBabJiNK4I1NhB0u8g&usqp=CAU') no-repeat center center"}}>
                Hello
            </div>
        </>
    )
}
